import React from 'react';
import jobs from '../data';

function AdminPanel() {
  return (
    <div>
      <h2>Admin Panel</h2>
      <h3>Posted Jobs</h3>
      <ul>
        {jobs.map(job => (
          <li key={job.id}>{job.title} - {job.company}</li>
        ))}
      </ul>
      <p>Admin features are placeholders.</p>
    </div>
  );
}

export default AdminPanel;
